import logo from './logo.svg';
import './App.css';
import { useState } from "react";

function App() {

  const [mobiliarios, setMobiliarios] = useState(null);

  const repApi = async () => {
    const api = await fetch("http://localhost:8080/api/mobiliario/listadoMobiliario");
    const listado = await api.json();

    setMobiliarios(listado.results)
  }

  console.log(mobiliarios);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Moviliario</h1>
        <button onClick={repApi}>
          Listar moviliario
        </button> 
      </header>
    </div>
  );
}

export default App;
